    report does not disclose any payments or wages on Schedule B supporting line 30(b)
    of the Detailed Summary Report because the committee does not have any employees
    who spend more than 25 percent of their time on Federal Election Activity.                                                                                                                                                    Per
    phone conversation with RAD, the allocation ratio for administrative expenses
    is governed per the date when the expense was incurred; not by the date when the
    expense and allocaiton is paid.  Therefore, this May 20 monthly report contains
    two H1 alloction schedules due to the fact that some accrued expenses (debts)
    that were paid in this month were acturally incurred in a previous allocation
    ratio period.\n"
